export const headerContainerStyle = () => {
  return {
    width: "100%",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    flexDirection: "row",
    position: "absolute",
    top: "0",
    left: "0",
    border: "1px solid white",
    padding: "20px",
  };
};

export const navLinkStyle = () => {
  return {
    textDecoration: "none",
    border: "1px solid red",
    margin: "0 5px",
    padding: "5px",
    font: "600 18px Inter,sans-serif",
    boxShadow: "5px 10px rgba(20,20,20,0.4)",
  };
};
